def remove_Occ(s, ch):
    import re
    first_occ = re.search(ch, s)
    last_occ = re.search(ch + '(?!.*' + ch + ')', s)

    if first_occ and last_occ:
        first_index = first_occ.start()
        last_index = last_occ.start()
        return s[:first_index] + s[first_index + 1:last_index] + s[last_index + 1:]
    elif first_occ:
        return s[:first_occ.start()] + s[first_occ.start() + 1:]
    elif last_occ:
        return s[:last_occ.start()] + s[last_occ.start() + 1:]
    else:
        return s

