        integer_part = dividend // divisor
        remainder = dividend % divisor
        decimal_part = ""
        remainders = {}

        while remainder != 0 and remainder not in remainders:
            remainders[remainder] = len(decimal_part)
            remainder *= 10
            decimal_part += str(remainder // divisor)
            remainder %= divisor

        if remainder != 0:
            start = remainders[remainder]
            decimal_part = decimal_part[:start] + "(" + decimal_part[start:] + ")"

        return str(integer_part) + "." + decimal_part, remainder

