def counting_sort(my_list: List[int]) -> List[int]:
    if not my_list:
        return my_list

    max_val = max(my_list)
    min_val = min(my_list)
    count = [0] * (max_val - min_val + 1)
    output = [0] * len(my_list)

    for num in my_list:
        count[num - min_val] += 1

    for i in range(1, len(count)):
        count[i] += count[i - 1]

    for num in my_list:
        output[count[num - min_val] - 1] = num
        count[num - min_val] -= 1

    return output

