def eulerian_num(n, m):
    if m == 0:
        return 1 if n == 0 else 0
    if n == 0 or m > n:
        return 0
    return (n - m) * eulerian_num(n - 1, m) + (m + 1) * eulerian_num(n - 1, m + 1)

def eulerian_num_iterative(n, m):
    dp = [[0 for _ in range(n + 1)] for _ in range(n + 1)]
    dp[0][0] = 1
    for i in range(n + 1):
        for j in range(min(i + 1, n + 1)):
            if j == 0:
                dp[i][j] = 1 if i == 0 else 0
            elif j > i:
                dp[i][j] = 0
            elif i > 0 and j > 0:
                if j + 1 <= n:
                    dp[i][j] = (i - j) * dp[i - 1][j] + (j + 1) * dp[i - 1][j + 1]
                else:
                    dp[i][j] = (i - j) * dp[i - 1][j]
    return dp[n][m]

