def amicable_numbers_sum(limit):
    def sum_of_divisors(n):
        sum_div = 1
        for i in range(2, int(math.sqrt(n)) + 1):
            if n % i == 0:
                if i * i != n:
                    sum_div += i + n // i
                else:
                    sum_div += i
        return sum_div

    amicable_sum = 0
    for i in range(1, limit):
        j = sum_of_divisors(i)
        if j < limit and sum_of_divisors(j) == i and i != j:
            amicable_sum += i
    return amicable_sum

