import numpy as np

def magic_square_test(my_matrix):
    n = len(my_matrix)
    expected_sum = n * (n**2 + 1) // 2

    # Check rows
    for row in my_matrix:
        if sum(row) != expected_sum:
            return False

    # Check columns
    for col in range(n):
        if sum(my_matrix[row][col] for row in range(n)) != expected_sum:
            return False

    # Check diagonals
    if sum(my_matrix[i][i] for i in range(n)) != expected_sum:
        return False
    if sum(my_matrix[i][n-i-1] for i in range(n)) != expected_sum:
        return False

    # Check if all numbers are unique and in range
    flat_list = [item for sublist in my_matrix for item in sublist]
    if len(flat_list) != len(set(flat_list)) or min(flat_list) < 1 or max(flat_list) > n**2:
        return False

    return True

def generate_magic_square(n):
    magic_square = [[0 for _ in range(n)] for _ in range(n)]
    i, j = 0, n//2

    for number in range(1, n**2 + 1):
        magic_square[i][j] = number
        next_i, next_j = (i-1) % n, (j+1) % n
        if magic_square[next_i][next_j]:
            i += 1
        else:
            i, j = next_i, next_j

    return magic_square

