def pancake_sort(nums):
    def flip(nums, k):
        return nums[:k+1][::-1] + nums[k+1:]

    n = len(nums)
    while n > 1:
        max_index = nums.index(max(nums[:n]))
        if max_index == n - 1:
            n -= 1
            continue
        if max_index != 0:
            nums = flip(nums, max_index)
        nums = flip(nums, n - 1)
        n -= 1
    return nums

