def min_Ops(arr: List[int], n: int, k: int) -> List[int]:
    median = sorted(arr)[n // 2]
    ops = 0
    for i in range(n):
        if arr[i] != median:
            diff = abs(arr[i] - median)
            if diff <= k:
                k -= diff
                arr[i] = median
                ops += 1
            else:
                if arr[i] < median:
                    arr[i] += k
                else:
                    arr[i] -= k
                k = 0
                break
    return arr

