def find_longest_repeating_subseq(s):
    n = len(s)
    dp = np.zeros((n+1, n+1))
    max_len = 0
    end = 0
    for i in range(1, n+1):
        for j in range(1, n+1):
            if i != j and s[i-1] == s[j-1]:
                dp[i][j] = dp[i-1][j-1] + 1
                if dp[i][j] > max_len:
                    max_len = dp[i][j]
                    end = i
            else:
                dp[i][j] = 0
    return s[end-max_len: end]

