def is_majority(arr: List[int], n: int, x: int) -> bool:
    left = 0
    right = n - 1
    while left <= right:
        mid = (left + right) // 2
        if arr[mid] == x:
            if mid == 0 or arr[mid - 1] != x:
                if mid + 1 < n and arr[mid + 1] != x:
                    count = 1
                    i = mid - 1
                    while i >= 0 and arr[i] == x:
                        count += 1
                        i -= 1
                    i = mid + 1
                    while i < n and arr[i] == x:
