def find_Min(arr: List[int], low: int, high: int) -> int:
    if low == high:
        return arr[low]
    if high == low + 1:
        return min(arr[low], arr[high])

    mid = (low + high) // 2

    if arr[mid] > arr[high]:
        return find_Min(arr, mid + 1, high)
    elif arr[mid] < arr[low]:
        return find_Min(arr, low, mid)
    elif arr[low] == arr[high] == arr[mid]:
        left_min = find_Min(arr, low, mid)
        right_min = find_Min(arr, mid + 1, high)
        return min(left_min, right_min)
    else:
