def lps(s: str) -> str:
    n = len(s)
    dp = [[0]*n for _ in range(n)]

    for i in range(n):
        dp[i][i] = 1

    for length in range(2, n+1):
        for i in range(n-length+1):
            j = i + length - 1
            if s[i] == s[j] and length == 2:
                dp[i][j] = 2
            elif s[i] == s[j]:
                dp[i][j] = dp[i+1][j-1] + 2
            else:
                dp[i][j] = max(dp[i][j-1], dp[i+1][j])

    i, j = 0, n-1
    lps_str = []
    while i <= j:
        if s[i] == s[j]:
            lps_str.append(s[i])
            i += 1
            j -= 1
        elif dp[i+1][j] > dp[i][j-1]:
            i += 1
        else:
            j -= 1

    return ''.join(lps_str + lps_str[::-1][1:] if len(lps_str) > 1 else lps_str)

