def zigzag(n, k):
    if k == 1:
        return [list(range(1, n+1))]
    result = []
    for p in itertools.permutations(range(1, n+1)):
        zigzag_sequence = [p[0]]
        for i in range(1, n):
            if zigzag_sequence[-1] < p[i]:
                zigzag_sequence.append(p[i]) if i % 2 == 1 else None
            elif zigzag_sequence[-1] > p[i]:
                zigzag_sequence.append(p[i]) if i % 2 == 0 else None
            else:
                break
        else:
            if len(zigzag_sequence) == n:
                result.append(list(zigzag_sequence))
    if result:
        return result[k-1] if k <= len(result) else []
    else:
        return []

