        return arr[0]

    incl = arr[0]
    excl = 0

    for i in range(1, n):
        new_excl = max(incl, excl)
        incl = excl + arr[i]
        excl = new_excl

    return max(incl, excl)

def longest_increasing_subsequence(arr, n):
    if n == 0:
        return 0

    dp = [1] * n
    for i in range(1, n):
        for j in range(i):
            if arr[i] > arr[j]:
                dp[i] = max(dp[i], dp[j] + 1)

    return max(dp)

def max_product_of_lis(arr, n):
    lis = longest_increasing_subsequence(arr, n)
    product = 1
    for i in range(lis):
        product *= arr[i]
    return product

def actual_max_product(arr, n):
    max_product_so_far = -math.inf
    current_product = 1
    for i in range(n):
        current_product *= arr[i]
        max_product_so_far = max(max_product_so_far, current_product)
        if current_product < 0:
            current_product = 1

    incl = [0]*n 
    excl = [0]*n 
    incl[0] = excl[0] = 1

    for i in range(1 , n): 
        incl[i] = excl[i-1] + 1
        if arr[i] > arr[i-1]: 
            excl[i] = incl[i-1] + 1
        else: 
            excl[i] = excl[i-1]

    max_len = max(incl[n-1], excl[n-1])

    actual_arr = []
    for i in range(n):
        actual_arr.append(arr[i])

    actual_arr.sort()
    actual_product = 1
    for i in range(max_len):
        actual_product *= actual_arr[n-i-1]

    return actual_product

