def max_profit(price: List[int], k: int) -> int:
    n = len(price)
    if n < 2:
        return 0

    if k >= n // 2:
        return sum(max(0, b - a) for a, b in zip(price, price[1:]))

    dp = [[0] * n for _ in range(k + 1)]

    for i in range(1, k + 1):
        max_diff = -price[0]
        for j in range(1, n):
            dp[i][j] = max(dp[i][j - 1], price[j] + max_diff)
            max_diff = max(max_diff, dp[i - 1][j] - price[j])

    return dp[k][n - 1]

