from typing import List

def binary_search(item_list: List[int], item: int) -> int:
    low = 0
    high = len(item_list) - 1
    while low <= high:
        mid = (low + high) // 2
        guess = item_list[mid]
        if guess == item:
            return mid
        if guess > item:
            high = mid - 1
        else:
            low = mid + 1
    return -1

